import React, { useState } from 'react';
import MainPage from "./小omponents/mainPages/MainPage";
import RegistrationPage from "./小omponents/registrationpage/RegistrationPage";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import "./App.css";


function App() {

  const [showRegistration, setShowRegistration] = useState(false);

  return (
    <Router>
    <Switch>
      <Route path="/" exact>
        {showRegistration ? <RegistrationPage /> : <MainPage />}
      </Route>
    </Switch>
  </Router>
  );
}

export default App;
